@Override
protected void finalize() throws Throwable {
  try {
    if (getOpenCount() != 0) {
      log.error("REFCOUNT ERROR: unreferenced " + this + " (" + getName()
          + ") has a reference count of " + getOpenCount());
    }
  } finally {
    super.finalize();
  }
}

